    "<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n-----Original Message-----<br />\nFrom: Damian Jenkins [mailto:djsix@comcast.net]<br />\nSent: Tuesday, November 25, 2003 12:51 AM<br />\nTo: trueloveg@earthlink.net<br />\nSubject: Re: Tyre Weathers\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nHi Gene,\n</p>\n<p>\nI am working on those dates for you. I hope I can be of some help.\n</p>\n<p>\nThank you so much for all of the time you put into the web site. It's so nice to see how everyone is related.\n</p>\n<p>\nI haven't been to N.C. since 1976. I stayed with Granny (Bessie) And Uncle Ottis and Ruth, Jasper and Janet. I love it there. I hope My Husband and I can make a trip back real soon.\n</p>\n<p>\nI work for a school district and my husband is a police officer. Our oldest (Andrew) is becoming a Paramedic. Tristan (daughter) is in Cosmetology school and Zach is a junior in high school.\n</p>\n<p>\nI will get as much info as I can for you. Thank you for answering me and I wish you and your family a wonderful Thanksgiving.\n</p>\n<p>\nDamian<br />\nHome: 253-925-1515<br />\ncell: 253-307-2256<br />\n-----Original Message-----<br />\nFrom: Damian Jenkins [mailto:djsix@comcast.net]<br />\nSent: Monday, November 24, 2003 11:14 PM<br />\nTo: trueloveg@earthlink.net<br />\nSubject: Tyre Weathers\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nHi\n</p>\n<p>\nMy name is Damian Weathers Jenkins. I am Tyre Weathers Daughter. My grandparents are Coy Weathers/Bessie Denson.\n</p>\n<p>\nDad passed away July 20th 1970. Age 44.\n</p>\n<p>\nTyre weathers married Mary Francis DeRosa.<br />\nChildren are: Thomas Coy Weathers, Damian Giesla Weathers and Gina Marie Weathers.\n</p>\n<p>\nMother is still alive. She is 77. in a nursing home. She suffered a major stoke in September 2002.\n</p>\n<p>\nThomas Coy weathers married Wendey Tatro<br />\nChildren are. Matthew Thomas Weathers and Kerry Renee Weathers.\n</p>\n<p>\nDamian Weathers married Douglas Paul Jenkins<br />\nChildren are. Andrew Douglas Jenkins, Tristan Kathleen Jenkins and Zachary Thomas Jenkins.\n</p>\n<p>\nGina Weathers has two children. Sarah Weathers Gordan and Damian Jewel Weathers Gordan.\n</p>\n<p>\nIt is wonderful to read about the family.\n</p>\n<p>\nWe live in Tacoma Washington. Please keep in touch.\n</p>\n<p>\nSincerely,<br />\nDamian\n</p>\n</div>\n</div>",
