    "<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nEmail Sent: Tue 3/5/2002 10:53 PM; Fr: Nancy Jane Capps\n</p>\n<p>\nHi Gene:\n</p>\n<p>\nThanks for the information and rapid response!  I will certainly send a completed copy of our tree when I get it correct and entered into the Family Tree program.\n</p>\n<p>\nAs for the name Janie Stroud-I know it. My great aunts mentioned STROUD to me.  I thought (but cannot say for certain without my notes here) that they gave me the surname STROUD as a part of our line.  I will have to check back with themas to where this STROUD fit in. The Wanda Skipper you responded to is my cousin. Our grandmothers were sisters. (Ellie &amp; Laura).\n</p>\n<p>\nI noticed another response on the Genforum from you stating that Tim Truelove came from a poor family and did well. I was told  our TRUELOVES were extremely wealthy and owned Cotton Gins. According to my late grandmother Laura Alice Parker Strickland, her grandfather kept his money in a safe and it was stolen. All of a sudden the Pope family who had been \"dirt poor\" as she put it, became mysteriously wealthy. They later found that someone had been \"put up to the crime by the Popes\" and was punished for it- but the Popes themselves were not.  No proof of this- just passed down personally by my grandmother to me.\n</p>\n<p>\nFor now- let me give you a quick run down (brief version):\n</p>\n<p>\n1.DAVID TRUELOVE B. abt<br />\n+ Susanna R. PHILLIPS (have more childrens names in file-will have to locate; order unknown)<br />\n2.CHESTER  TRUELOVE (migrated to CHESAPEAKE VA then Long Island, NY Was in Partnership w/ the late Arthur Godfrey in VA)<br />\n+ BESS<br />\n2.MATTIE TRUELOVE b. Oct  d. December 1974 or 75<br />\n+  John Ken PARKER d. July 26, 1955 ( son of John M. PARKER &amp; Sybil BEASLEY- Johnston County.NC)<br />\n3. LAURA ALICE PARKER b. May 17, 1911 - d. October 06, 1991 *See bottom for brothers and sister names<br />\n+ William Brasco STRICKLAND b. December 07, 1903 d. January 02, 1986 (son of George William Strickland of Sampson County, NC)<br />\n4. Child stillborn<br />\n4.  Mary Ann STRICKLAND (living)<br />\n+ James Edison CAPPS (living)<br />\n5. Nancy Jean CAPPS (SELF) (*Retained name of CAPPS; reverted back after Divorce.)<br />\n+ Felix Davide STANSFIELD<br />\n6. Rachel Anne CAPPS (Gave maiden suname)<br />\n+ Michael Edward Thaman<br />\n6. James Alexander CAPPS-THAMAN<br />\n4.  Child stillborn<br />\n4.  Alice Yvonne STRICKLAND June 16, 1936 - May 2001<br />\n+ \"Buddy\" BELL ( 1st husband - biological father of children)<br />\n5. Gloria Diane (Bell) VEAHMAN (Migrated to Salt Lake City, Utah)<br />\n+ Floyd \"Gus\" GUSTAVESON<br />\n6. Nicholas GUSTAVESON<br />\n6. Angela  GUSTAVESON <br />\n6. Kirstin GUSTAVESON <br />\n5. Sandy Lee (Bell) VEAHMAN<br />\n+ Robert WILSON (migrated to Jacksonville, Florida)<br />\n6. Michael WILSON<br />\n6. Michelle WILSON<br />\n6. Lisa WILSON<br />\n5. William (Bell) VEAHMAN (2002 - Living in Phoenix, Arizona)<br />\n+ Yvonne<br />\n6. Phillip VEAHMAN<br />\n6. Amanda VEAHMAN (2002 - Living in Texas)<br />\n5.  Deborah (Bell) VEAHMAN (2002 - Living in N.Y. State)<br />\n+  Phillip H. VEAHMAN d. 1991 (2cd husband- Adoptive father of children.)\n</p>\n</div>\n</div>",
