    "<div>\n<i class=\"NoteType\">\nSource Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n-----Original Message-----<br />\nFrom: Cooks [mailto:cooks@olg.com]<br />\nSent: Tuesday, August 19, 2003 9:15 PM<br />\nTo: trueloveg@earthlink.net<br />\nSubject: T H Johnson Link to Truelove\n</p>\n<p>\nBy chance I came across your site.  T H Johnson was my materal grandfather.  Our family has only recently developed any interest in the past.  But I can share with you the information provided by my mother about her father's family.\n</p>\n<p>\nBorn Thaddus Johnson (no middle name, he used T H as his initials)<br />\nMom's memory had his mother's name as Margaret Ellen Truelove and Harim Johnson from Vance County, NC was his father.  His mother died when he was about 18 years old.\n</p>\n<p>\nHe had 4 brothers and 1 sister<br />\nVannie Johnson<br />\nWilliam Johnson<br />\nJulius Johnson<br />\nRuffie Johnson<br />\nMartha Johnson Knight<br />\nOne Half-brother and one half-sister<br />\nIrvin Johnson<br />\nBessie Johnson Faultner\n</p>\n<p>\nT H Johnson was born Dec. 8, 1878 in Harnette County.  He died June 15, 1968 in Brunswick County NC buried at Antioch Baptist Church, Bolivia NC. (90 years old)\n</p>\n<p>\nHe married Nannie Eve Hester born 6-25, 1884 in Wake County.\n</p>\n<p>\nThey had thirteen children,<br />\nElnora Heather Osborne<br />\nHoward Julian Johnson<br />\nHerbert Alton Johnson<br />\nHorace Thaddus Johnson<br />\nEdwin Fenner Johnson<br />\nArchibald Johnson<br />\nMargaret Ellen Johnson Futch Maultsby<br />\nSherwood Grant Johnson<br />\nMilton Hugh Johnson<br />\nEthel Elaine Johnson Lewis<br />\nLouise Maida Johnson Padgett<br />\nDoris Virginia Johnson Obenauf<br />\nUnnamed baby girl\n</p>\n<p>\nJanet Lewis Cook, daughter of T H Johnson's daughter Ethel\n</p>\n</div>\n</div>",
